from scipy.sparse import csr_matrix
import numpy as np

def load_sparse_csr(filename):
    loader = np.load(filename)
    return csr_matrix((  loader['data'], loader['indices'], loader['indptr']),
                         shape = loader['shape'])
						 
def getNumber( fim, line):
	a = line.find(";",fim)
	return line[fim+1:a]

def addPuntoComa(line):
	if line[0] != ";":
		return ";"+line
	return line
	
